import 'package:bloc/bloc.dart';
import 'package:meta/meta.dart';

part 'story_state.dart';

class StoryCubit extends Cubit<StoryInitial> {
  StoryCubit() : super(StoryInitial('assets/pictures/messi'));

  void changeImage() => emit(StoryInitial('assets/pictures/bron'));
}
